import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';
import './MyTripsListing.css';

const MyTripsListing = () => {
  const [prompts, setPrompts] = useState([]);
  const [loading, setLoading] = useState(true);
  const navigate = useNavigate();

  // Fetch all previous prompts from backend
  useEffect(() => {
    const fetchPrompts = async () => {
      try {
        const API_ENDPOINT = process.env.REACT_APP_API_URL || 'http://localhost:8000/api/trip-planner';
        const response = await fetch(`${API_ENDPOINT}/prompts`, {
          method: 'GET',
          headers: {
            'Content-Type': 'application/json',
          },
        });

        if (response.ok) {
          const data = await response.json();
          setPrompts(data.prompts || []);
        } else {
          setPrompts([]);
        }
      } catch (error) {
        console.error('Error fetching prompts:', error);
        setPrompts([]);
      } finally {
        setLoading(false);
      }
    };

    fetchPrompts();
  }, []);

  // Sample prompts for demonstration
  const samplePrompts = [
    {
      id: 1,
      prompt: "I'm planning a 10-day trip to Japan in March 2024. I have diabetes and need to ensure medical facilities are accessible.",
      timestamp: '2024-01-15T10:30:00.000Z',
      participants: 3,
      lastMessage: 'Let\'s finalize the hotel bookings',
      unreadCount: 2
    },
    {
      id: 2,
      prompt: "Planning a romantic getaway to Paris in May 2024. Looking for budget-friendly hotels near public transportation.",
      timestamp: '2024-01-20T14:15:00.000Z',
      participants: 2,
      lastMessage: 'The Eiffel Tower tickets are booked!',
      unreadCount: 0
    },
    {
      id: 3,
      prompt: "Family trip to Bali in July 2024. Need family-friendly activities and accommodations.",
      timestamp: '2024-02-01T09:00:00.000Z',
      participants: 4,
      lastMessage: 'Weather looks great for that week',
      unreadCount: 5
    },
    {
      id: 4,
      prompt: "Solo adventure to New York in September 2024. Looking for safe neighborhoods and cultural experiences.",
      timestamp: '2024-02-10T16:45:00.000Z',
      participants: 1,
      lastMessage: 'Broadway show recommendations?',
      unreadCount: 1
    },
  ];

  const displayPrompts = prompts.length > 0 ? prompts : samplePrompts;

  const formatDate = (timestamp) => {
    const date = new Date(timestamp);
    return date.toLocaleDateString('en-US', { 
      year: 'numeric', 
      month: 'short', 
      day: 'numeric',
      hour: '2-digit',
      minute: '2-digit'
    });
  };

  const truncatePrompt = (text, maxLength = 100) => {
    if (text.length <= maxLength) return text;
    return text.substring(0, maxLength) + '...';
  };

  const handleChatClick = (promptId) => {
    navigate(`/trips/${promptId}/chat`);
  };

  if (loading) {
    return (
      <div className="trips-listing-page">
        <div className="listing-header">
          <h1>My Trips</h1>
        </div>
        <div className="trips-loading">
          <p>Loading your trips...</p>
        </div>
      </div>
    );
  }

  return (
    <div className="trips-listing-page">
      <div className="listing-header">
        <h1>My Trips</h1>
        <p className="listing-subtitle">All your travel planning conversations</p>
      </div>

      {displayPrompts.length === 0 ? (
        <div className="trips-empty">
          <p>You don't have any trips yet. Start planning your first adventure!</p>
        </div>
      ) : (
        <div className="prompts-list">
          {displayPrompts.map((item) => (
            <div 
              key={item.id} 
              className="prompt-item"
              onClick={() => handleChatClick(item.id)}
            >
              <div className="prompt-item-content">
                <div className="prompt-header">
                  <h3 className="prompt-title">
                    Trip #{item.id} - {formatDate(item.timestamp)}
                  </h3>
                  <div className="prompt-meta">
                    <span className="participants-count">
                      ðŸ‘¥ {item.participants} {item.participants === 1 ? 'person' : 'people'}
                    </span>
                    {item.unreadCount > 0 && (
                      <span className="unread-badge">{item.unreadCount}</span>
                    )}
                  </div>
                </div>
                <p className="prompt-text">{truncatePrompt(item.prompt)}</p>
                {item.lastMessage && (
                  <div className="last-message">
                    <span className="last-message-label">Last message:</span>
                    <span className="last-message-text">{item.lastMessage}</span>
                  </div>
                )}
              </div>
              <div className="prompt-arrow">
                <svg width="20" height="20" viewBox="0 0 24 24" fill="none" xmlns="http://www.w3.org/2000/svg">
                  <path d="M5 12H19M19 12L12 5M19 12L12 19" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
                </svg>
              </div>
            </div>
          ))}
        </div>
      )}
    </div>
  );
};

export default MyTripsListing;
